import Header from '../Components/Header/Header';
import Footer from '../Components/Footer/Footer';
import Pdv from '../Components/Projeto_Pdv/Pdv'


function PaginaPdv() {
  return (
    <>
      <Header />
      <Pdv />
      <Footer />
    </>
  );
}

export default PaginaPdv;
